@MartelsAxe @erik_degard @Partisangirl This is a legitimate question.
But when you wonder about these issues, never forget the numbers: 6 million of Jews killed. 50 million of humans anihilated.
It always start with the Jews in Europe. Always. That's why a few countries, terrified by these numbers, took legal mesures.

